import React from 'react';
import Product from './Product';

const ProductItem =({product})=>(
    <div>
        <Product
        img={product.img}
        title={product.title}
        price={product.price}
        />
        <button>
            add to cart
        </button>
    </div>
)

export default ProductItem;
